--
-- Create procedure `Proc_Employee_Update`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_Update (IN v_EmployeeId char(36), IN v_EmployeeCode varchar(20), IN v_FullName varchar(100), IN v_DepartmentId char(36), IN v_PositionName varchar(255), IN v_DateOfBirth date, IN v_Gender tinyint, IN v_IdentityNumber varchar(25), IN v_IdentityDateRelease date, IN v_IdentityPlaceRelease varchar(255), IN v_Address varchar(255), IN v_MobilePhoneNumber varchar(50), IN v_PhoneNumber varchar(50), IN v_Email varchar(100), IN v_BankAccount varchar(25), IN v_BankName varchar(255), IN v_BankBranch varchar(255), IN v_ModifiedBy char(36), IN v_ModifiedDate datetime, IN v_IsCustomer bit, IN v_IsSupplier bit)
COMMENT 'Cập nhật nhân viên'
