  SET EmployeeCode = v_EmployeeCode,
      FullName = v_FullName,
      DepartmentId = v_DepartmentId,
      PositionName = v_PositionName,
      DateOfBirth = v_DateOfBirth,
      Gender = v_Gender,
      IdentityNumber = v_IdentityNumber,
      IdentityDateRelease = v_IdentityDateRelease,
      IdentityPlaceRelease = v_IdentityPlaceRelease,
      Address = v_Address,
      MobilePhoneNumber = v_MobilePhoneNumber,
      PhoneNumber = v_PhoneNumber,
      Email = v_Email,
      BankAccount = v_BankAccount,
      BankName = v_BankName,
      BankBranch = v_BankBranch,
      CreatedDate = v_CreatedDate,
      ModifiedDate = v_ModifiedDate,
      IsCustomer = v_IsCustomer,
      IsSupplier = v_IsSupplier
  WHERE EmployeeId = v_EmployeeId;
END
$$

