--
-- Create procedure `Proc_Employee_GetNewCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetNewCode ()
COMMENT 'Tạo mã nhân viên mới nhất'
BEGIN
  DECLARE lastNumber int;
  DECLARE newCode varchar(20);

  -- Lấy số mã nhân viên lớn nhất từ bảng
  SELECT
    MAX(CAST(SUBSTRING_INDEX (EmployeeCode, '-', -1) AS UNSIGNED)) INTO lastNumber
  FROM employee;

  -- Kiểm tra nếu không có mã nhân viên tồn tại
  IF lastNumber IS NULL THEN
    SET newCode = 'NV-0001';
  ELSE
    -- Tạo mã mới bằng cách thực hiện phép cộng
    -- SET newCode = CONCAT('NV-', LPAD(lastNumber + 1, 4, '0'));
    SET newCode = CONCAT('NV-', lastNumber + 1);

  END IF;

  -- In mã nhân viên mới
  SELECT
    newCode AS new_employee_code;
END
$$

--
-- Create procedure `Proc_Employee_GetListByFilter`
