PROCEDURE Proc_Employee_GetListByFilter (IN v_KeySearch varchar(255))
COMMENT 'lay danh sach nhan vien theo filter'
BEGIN
  DECLARE compareString varchar(255) DEFAULT '';
  SET compareString = CONCAT('%', v_KeySearch, '%');

  -- lay danh sach nhan vien theo tham so dau vao
  SELECT
    e.EmployeeId,
    e.EmployeeCode,
    e.FullName,
    e.DepartmentId,
    d.DepartmentName,
    e.PositionName,
    e.DateOfBirth,
    e.Gender,
    e.IdentityNumber,
