  FROM employee e,
       department d
  WHERE e.DepartmentId = d.DepartmentId
  AND (e.EmployeeCode LIKE compareString
  OR e.FullName LIKE compareString
  OR e.MobilePhoneNumber LIKE compareString
  OR e.PhoneNumber LIKE compareString);

END
$$

--
-- Create procedure `Proc_Employee_GetList`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetList (IN v_Limit int, IN v_Offset int, IN v_KeySearch varchar(255))
COMMENT 'loc va phan trang danh sach nhan vien'
BEGIN

  DECLARE compareString varchar(255) DEFAULT '';
  SET compareString = CONCAT('%', v_KeySearch, '%');

  -- lay tong so ban ghi theo dieu kien loc
  SELECT
    COUNT(*) AS TotalRecords
  FROM employee e
  WHERE (e.EmployeeCode LIKE compareString
  OR e.FullName LIKE compareString
  OR e.MobilePhoneNumber LIKE compareString
