--
-- Create procedure `Proc_TermPayment_GetList`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_TermPayment_GetList (IN v_Limit int, IN v_Offset int, IN v_KeySearch varchar(255))
COMMENT 'Lấy danh sách điều khoản thanh toán theo từ khóa tìm kiếm
created by: vdtien (27/7/2023)
call Proc_TermPayment_GetList()'
BEGIN

  DECLARE compareString varchar(255) DEFAULT '';
  SET compareString = CONCAT('%', v_KeySearch, '%');

  SELECT
    COUNT(1)
  FROM termpayment t
  WHERE t.TermPaymentCode LIKE compareString
  OR t.TermPaymentName LIKE compareString;

  SELECT
    t.TermPaymentId,
    t.TermPaymentCode,
    t.TermPaymentName,
    t.DueTime,
    t.DiscountPeriod,
    t.DiscountRate,
    t.CreatedBy,
    t.CreatedDate,
    t.ModifiedBy,
    t.ModifiedDate,
    t.Active
  FROM termpayment t
  WHERE t.TermPaymentCode LIKE compareString
  OR t.TermPaymentName LIKE compareString
  LIMIT v_Limit
  OFFSET v_Offset;


END
