--
-- Create procedure `Proc_Supplier_GetNewCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Supplier_GetNewCode ()
COMMENT 'Lấy mã nhà cung cấp mới
created by: vdtien (25/7/2023)'
BEGIN
  DECLARE max_supplier_number bigint;
  DECLARE new_supplier_code varchar(20);

  -- Tìm mã số lớn nhất trong bảng có dạng SL-<mã số>
  SELECT
    MAX(CAST(SUBSTRING(SupplierCode, 4) AS UNSIGNED)) INTO max_supplier_number
  FROM supplier
  WHERE SupplierCode LIKE 'NCC%';

  -- Nếu không có bản ghi nào có dạng SL-<mã số>, bắt đầu với mã số 1
  IF max_supplier_number IS NULL THEN
    SET max_supplier_number = 0;
  END IF;

  -- Tạo mã nhà cung cấp mới
  SET new_supplier_code = CONCAT('NCC', max_supplier_number + 1);

  -- Hiển thị mã nhà cung cấp mới
  SELECT
    new_supplier_code AS new_code;
END
$$

