--
-- Create procedure `Proc_Payment_GetAllExcel`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Payment_GetAllExcel (IN v_KeySearch varchar(255))
COMMENT 'Lấy danh sách phiếu chi xuất excel 
created by: vdtien (18/8/2023)
call Proc_Payment_GetAllExcel()'
BEGIN
  DECLARE compareString varchar(255) DEFAULT '';
  SET compareString = CONCAT('%', v_KeySearch, '%');

  SELECT
    @row_number := @row_number + 1 AS NumberOrder,
    p.PaymentCode,
    p.AccountingDate,
    p.PaymentDate,
    p.Receiver,
    p.SupplierName,
    p.Address,
    p.ReasonSpending,
    p.ReasonTypeId,
    p.TotalMoney
  FROM payment p,
       (SELECT
           @row_number := 0) AS t
  WHERE p.PaymentCode LIKE compareString
  OR p.SupplierName LIKE compareString
  OR p.Address LIKE compareString
  OR p.Receiver LIKE compareString;
END
$$

