--
-- Create procedure `Proc_Payment_GetList`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Payment_GetList (IN v_Limit int, IN v_Offset int, IN v_KeySearch varchar(255), OUT TotalRecord int)
COMMENT 'Lấy danh sách phiếu chi theo phân trang và tìm kiếm
created by: vdtien (15/8/2023)
call Proc_Payment_GetList()'
BEGIN

  DECLARE compareString varchar(255) DEFAULT '';
  SET compareString = CONCAT('%', v_KeySearch, '%');

  -- lay tong so ban ghi
  SELECT
    COUNT(1) INTO TotalRecord
  FROM payment p
    LEFT JOIN supplier s
      ON p.SupplierId = s.SupplierId
  WHERE p.PaymentCode LIKE compareString
  OR s.SupplierCode LIKE compareString
  OR p.SupplierName LIKE compareString
  OR p.Address LIKE compareString
  OR p.Receiver LIKE compareString
  OR p.ReasonSpending LIKE compareString;

  WITH tmpPaymentId
  AS
  (SELECT
        p.PaymentId
      FROM payment p
        LEFT JOIN supplier s
          ON p.SupplierId = s.SupplierId
      WHERE p.PaymentCode LIKE compareString
      OR s.SupplierCode LIKE compareString
      OR p.SupplierName LIKE compareString
      OR p.Address LIKE compareString
      OR p.Receiver LIKE compareString
      OR p.ReasonSpending LIKE compareString
      LIMIT v_Limit
      OFFSET v_Offset)


  SELECT
    vpa.PaymentId,
    vpa.SupplierId,
    vpa.EmployeeId,
    vpa.ReasonTypeId,
    vpa.PaymentCode,
    vpa.AttachOriginalDocuments,
    vpa.AccountingDate,
    vpa.PaymentDate,
    vpa.Receiver,
    vpa.SupplierCode,
    vpa.SupplierName,
    vpa.Address,
    vpa.ReasonSpending,
    vpa.EmployeeName,
    vpa.PaymentStatus,
    vpa.TotalMoney,
    vpa.CreatedBy,
    vpa.CreatedDate,
    vpa.ModifiedBy,
    vpa.ModifiedDate,

    vpa.AccountingId,
    vpa.AccountDebtId,
    vpa.AccountDebtCode,
    vpa.AccountBalanceId,
    vpa.AccountBalanceCode,
    vpa.AccountingExplain,
    vpa.Money
  FROM view_payment_accounting_account vpa
  WHERE vpa.PaymentId IN (SELECT
      PaymentId
    FROM tmpPaymentId);

END
$$

