--
-- Create view `view_supplier_getall`
--
CREATE
DEFINER = 'root'@'localhost'
VIEW view_supplier_getall
AS
SELECT
  `s`.`SupplierId` AS `SupplierId`,
  `s`.`SupplierCode` AS `SupplierCode`,
  `s`.`SupplierName` AS `SupplierName`,
  `s`.`TaxCode` AS `TaxCode`,
  `s`.`Address` AS `Address`,
  `s`.`PhoneNumber` AS `PhoneNumber`,
  `s`.`Website` AS `Website`,
  CASE WHEN COUNT(`g`.`GroupSupplierId`) > 0 THEN JSON_ARRAYAGG(`g`.`GroupSupplierId`) ELSE JSON_ARRAY() END AS `GroupSuppliersId`,
  `s`.`EmployeeId` AS `EmployeeId`,
  `e`.`EmployeeCode` AS `EmployeeCode`,
  `e`.`FullName` AS `EmployeeName`,
  `s`.`SupplierType` AS `SupplierType`,
  `s`.`Status` AS `Status`,
  `s`.`IsCustomer` AS `IsCustomer`,
  `s`.`ContractInfor` AS `ContractInfor`,
  `s`.`TermPaymentId` AS `TermPaymentId`,
  `t`.`TermPaymentCode` AS `TermPaymentCode`,
  `t`.`TermPaymentName` AS `TermPaymentName`,
  `s`.`DueTime` AS `DueTime`,
  `s`.`MaxAccountOfDebt` AS `MaxAccountOfDebt`,
  `s`.`AccountPayableId` AS `AccountPayableId`,
  `a1`.`AccountCode` AS `AccountPayableCode`,
  `a1`.`AccountName` AS `AccountPayableName`,
  `s`.`AccountReceivableId` AS `AccountReceivableId`,
  `a2`.`AccountCode` AS `AccountReceivableCode`,
  `a2`.`AccountName` AS `AccountReceivableName`,
  `s`.`BanksAccount` AS `BanksAccount`,
  `s`.`DeliverAddress` AS `DeliverAddress`,
  `s`.`CountryId` AS `CountryId`,
  `l1`.`LocationName` AS `CountryName`,
  `s`.`CityId` AS `CityId`,
  `l2`.`LocationName` AS `CityName`,
  `s`.`DistrictId` AS `DistrictId`,
  `l3`.`LocationName` AS `DistrictName`,
  `s`.`WardId` AS `WardId`,
  `l3`.`LocationName` AS `WardName`,
  `s`.`IsSameSupplierAddress` AS `IsSameSupplierAddress`,
  `s`.`Note` AS `Note`
FROM ((((((((((`supplier` `s`
  LEFT JOIN `supplier_groupsupplier` `sg`
    ON (`s`.`SupplierId` = `sg`.`SupplierId`))
  LEFT JOIN `groupsupplier` `g`
    ON (`sg`.`GroupSupplierId` = `g`.`GroupSupplierId`))
  LEFT JOIN `employee` `e`
    ON (`s`.`EmployeeId` = `e`.`EmployeeId`))
  LEFT JOIN `account` `a1`
    ON (`s`.`AccountPayableId` = `a1`.`AccountId`))
  LEFT JOIN `account` `a2`
    ON (`s`.`AccountReceivableId` = `a2`.`AccountId`))
  LEFT JOIN `termpayment` `t`
    ON (`s`.`TermPaymentId` = `t`.`TermPaymentId`))
  LEFT JOIN `location` `l1`
    ON (`s`.`CountryId` = `l1`.`LocationId`))
  LEFT JOIN `location` `l2`
    ON (`s`.`CityId` = `l2`.`LocationId`
    AND `l2`.`ParentId` = `l1`.`LocationId`))
  LEFT JOIN `location` `l3`
    ON (`s`.`DistrictId` = `l3`.`LocationId`
    AND `l3`.`ParentId` = `l2`.`LocationId`))
  LEFT JOIN `location` `l4`
    ON (`s`.`WardId` = `l4`.`LocationId`
    AND `l4`.`ParentId` = `l3`.`LocationId`))
GROUP BY `s`.`SupplierId`;

DELIMITER $$

