--
-- Create procedure `Proc_Account_GetListTree`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Account_GetListTree (IN v_Limit int, IN v_Offset int, IN v_KeySearch varchar(255))
COMMENT 'lấy danh sách theo cây
created by: vdtien (17/7/2023)
call Proc_Account_GetListTree(10,0,"111")'
BEGIN

  DECLARE compareString varchar(255) DEFAULT '';
  SET compareString = CONCAT('%', v_KeySearch, '%');

  IF compareString = '%%' THEN

    -- lay tong so ban ghi theo dieu kien loc
    SELECT
      COUNT(1) AS TotalRecords
    FROM account a;

    SELECT
      COUNT(1) AS TotalRoots
    FROM account a
    WHERE a.ParentId IS NULL;
    SELECT
      a.AccountId,
      a.KeyCode,
      a.AccountCode,
      a.AccountName,
      a.AccountNameEnglish,
      a.ParentId,
      a.AccountFeature,
      a.`Explain`,
      a.Status,
      a.IsParent,
      a.Grade,
      a.NumberChilds,
      a.UserObject,
      a.CreatedBy,
      a.CreatedDate,
      a.ModifiedBy,
      a.ModifiedDate
    FROM account a
    WHERE a.ParentId IS NULL
    AND (a.AccountCode LIKE compareString
    OR a.AccountNameEnglish LIKE compareString
    OR a.AccountName LIKE compareString)
    ORDER BY a.KeyCode
    LIMIT v_Limit OFFSET v_Offset;

  ELSE

    -- lay tong so ban ghi
    WITH RECURSIVE cte
    AS
    (SELECT
          AccountId,

          ParentId

        FROM account
        WHERE (AccountCode LIKE compareString
        OR AccountNameEnglish LIKE compareString
        OR AccountName LIKE compareString)
      UNION ALL
      SELECT
        a.AccountId,
        a.ParentId
      FROM account a
        INNER JOIN cte
          ON a.AccountId = cte.ParentId)
    SELECT
      COUNT(DISTINCT AccountId) AS TotalRecords
    FROM cte;

    -- lay tong so nut goc
    SELECT
      COUNT(DISTINCT a.KeyRoot) AS TotalRoots
    FROM account a
    WHERE (a.AccountCode LIKE compareString
    OR a.AccountNameEnglish LIKE compareString
    OR a.AccountName LIKE compareString);

    -- lay limit offset keyroot
    /*   with selected_accounts
       AS
       (SELECT
             a.KeyRoot
           FROM account a
           WHERE (a.AccountCode LIKE compareString
           OR a.AccountNameEnglish LIKE compareString
           OR a.AccountName LIKE compareString)
           GROUP BY a.KeyRoot
           LIMIT v_Limit
           OFFSET v_Offset)
   */
    -- Giải phóng bảng tạm thời
    DROP TEMPORARY TABLE IF EXISTS selected_keyroots;
    CREATE TEMPORARY TABLE selected_keyroots AS
    SELECT DISTINCT
      a.KeyRoot
    FROM account a
    WHERE (a.AccountCode LIKE compareString
    OR a.AccountNameEnglish LIKE compareString
    OR a.AccountName LIKE compareString)
    GROUP BY a.KeyRoot
    LIMIT v_Limit
    OFFSET v_Offset;


    -- CTE đệ quy thứ hai
    WITH RECURSIVE act
    AS
    (SELECT
          AccountId,
          KeyRoot,
          KeyCode,
          AccountCode,
          AccountName,
          AccountNameEnglish,
          ParentId,
          AccountFeature,
          `Explain`,
          Status,
          IsParent,
          Grade,
          NumberChilds,
          UserObject,
          CreatedBy,
          CreatedDate,
          ModifiedBy,
          ModifiedDate
        FROM account
        WHERE KeyRoot IN (SELECT
            KeyRoot
          FROM selected_keyroots)
        AND (AccountCode LIKE compareString
        OR AccountNameEnglish LIKE compareString
        OR AccountName LIKE compareString)
      UNION ALL
      SELECT
        a2.AccountId,
        a2.KeyRoot,
        a2.KeyCode,
        a2.AccountCode,
        a2.AccountName,
        a2.AccountNameEnglish,
        a2.ParentId,
        a2.AccountFeature,
        a2.`Explain`,
        a2.Status,
        a2.IsParent,
        a2.Grade,
        a2.NumberChilds,
        a2.UserObject,
        a2.CreatedBy,
        a2.CreatedDate,
        a2.ModifiedBy,
        a2.ModifiedDate

      FROM account a2
        INNER JOIN act
          ON a2.AccountId = act.ParentId)

    SELECT

    DISTINCT
      AccountId,
      KeyRoot,
      KeyCode,
      AccountCode,
      AccountName,
      AccountNameEnglish,
      ParentId,
      AccountFeature,
      `Explain`,
      Status,
      IsParent,
      Grade,
      NumberChilds,
      UserObject,
      CreatedBy,
      CreatedDate,
      ModifiedBy,
      ModifiedDate
    FROM act
    ORDER BY KeyCode;
    -- SELECT COUNT(DISTINCT AccountId)  FROM act;
    -- Giải phóng bảng tạm thời
    DROP TEMPORARY TABLE IF EXISTS selected_keyroots;

  -- SET @sql = CONCAT('SELECT AccountId,KeyCode,AccountCode,AccountName,AccountNameEnglish,ParentId,AccountFeature,`Explain`,Status,IsParent,Grade,NumberChilds,UserObject,CreatedBy,CreatedDate,ModifiedBy,ModifiedDate FROM account  WHERE (AccountCode LIKE ','\'',compareString,'\'','OR AccountNameEnglish LIKE ','\'',compareString,'\'','OR AccountName LIKE ','\'',compareString,'\'',') AND ParentId IN (', v_ListParentId, ')');
  -- PREPARE stmt FROM @sql;
  -- EXECUTE stmt;
  -- DEALLOCATE PREPARE stmt;
  END IF;

END
$$

